    false,nt"url": null,nt"notes": "Rugosity is derived from gridded (5 m cell
    size) bathymetry, from three sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; Multibeam bathymetry
    collected aboard the US Naval Ship Sumner, and lidar, both collected by Naval Oceanographic
    Office; and bathymetry derived from multispectral IKONOS satellite imagery. Rugosity
    is derived using the Benthic Terrain Modeler with rugosity methods by Jeff Jenness
    (2003). Cell values reflect the (surface area) / (planimetric area) ratio for the
    area contained within that cell's boundaries. They provide indices of topographic
    roughness & convolutedness. This data set is for Tinian and Aguijan Islands, and
    Tatsumi Bank, Commonwealth of the Northern Marianas (CNMI).",nt"license_title":
